  

// TypeScript Version: 4.1

/**
* Converts an angle from degrees to radians (single-precision).
*
* @param x - angle in degrees
* @returns angle in radians
*
* @example
* var r = deg2radf( 90.0 );
* // returns ~1.571
*
* @example
* var r = deg2radf( -45.0 );
* // returns ~-0.785
*
* @example
* var r = deg2radf( NaN );
* // returns NaN
*/
declare function deg2radf( x: number ): number;


// EXPORTS //

export = deg2radf;
